    [],nt"revision_timestamp": "2016-04-11T19:54:11.112885",nt"name": "city-and-bureau-of-juneau-lidar",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset is LiDAR point cloud data,
    which encompasses a 100 meter buffer around the Juneau,AK study area, approximately
    121,313 acres. Dataset Description: This dataset consists of 1273 .LAS files delineated
    in 750 x 750 m tiles and named as specified by the client. Each .LAS file contains
    LiDAR point information, which has been calibrated, controlled, and classified.
    LAS points contain RGB values from orthoimagery mosaics. Normalized intensity values
    are represented in the intensity field in this version of the point cloud. Ground
    Conditions: LiDAR acquisition of near shore areas was prioritized to coincide with
    the lowest tides possible, within constraints of daily local weather patterns. Leaf-off,
    no snow conditions were targeted in all other areas given the diverse terrain represented
    in the study area. Upon arrival at NOAA's Office for Coastal Management the following
    classes were reclassed: Class 12 (mobile) reclassed to class 19 Class 11 (withheld)
    reclassed to class 20 Class 13 (utilities) reclassed to class 21 Class 14 (bridges)
    reclassed to class 22 Class 15 (ice) reclassed to class 23 Class 16 (snow - based
    on photos*)reclassed to class 24 Class 17 (decks) reclassed to class 25 Class 18
    (awnings) reclassed to class 27",nt"license_title": null,nt"extras": [{ntt"key":
