    "completed"nt},nt{ntt"key": "access_constraints",ntt"value": "["Use
    Constraints: In some areas of heavy vegetation or forest cover, there may be relatively
    few ground points in the LiDAR data. TINing the points produces large triangles
    and hence the elevations may be less accurate within such areas. Elevation values
    for open water surfaces are derived from waters edge breaklines. Triangles were
    created across water surfaces by interpolating from the nearest breakline elevation
    points. RandM Engineering Inc. (Mark A. Johnson - AKPLS#7570) provided the Mean
    Lower Low Water (MLLW) elevation adjustment for all monuments used for the project.
    These MLLW elevations were determined by running level loops from tidal benchmarks
    with published MLLW elevations to each monument. Differences between the orthometric
    elevations of each monument on Geoid 12A and the MLLW elevations can be found in
    Appendix B of the Juneau LiDAR data report. The average MLLW adjustment was approximately
    1.045m with a standard deviation of 0.066m. As a result of being calibrated using
    the ellipsoidal MLLW elevations instead of the normal ellipsoidal elevations, the
    LiDAR data was adjusted to the MLLW vertical datum. Users should be aware that temporal
    changes may have occurred since this data set was collected and some parts of this
    data may no longer represent actual surface conditions. Users should not use this
    data for critical applications without a full awareness of its limitations. These
    data depict the heights at the time of the survey and are only accurate for that
    time.", "Access Constraints: No restrictions apply to this data."]"nt},nt{ntt"key":
